import React from 'react';

class NavBar extends React.Component {
    render() {
        return <aside className="mdc-drawer mdc-drawer--dismissible mdc-drawer--open">
            <div className="mdc-drawer__header">
                <h3 className="mdc-drawer__title">Devices Dashboard</h3>
                <h6 className="mdc-drawer__subtitle">
                  Test
                </h6>
            </div>
            <div className="mdc-drawer__content">
                <div className="mdc-list">
                        <a class="mdc-list-item ' . $selectedClass . '" href="../Pages/' . $tab['link'] . '" aria-current="page">';
                        <i class="material-icons mdc-list-item__graphic" aria-hidden="true"> $tab['icon'] </i>';
                        <span class="mdc-list-item__text"> $tab['name'] </span>;
                        </a>

                    {/* Bottom Navigation */}
                    <a className="mdc-list-item bottomTabsForNav" href="../API/logout.php">
                        <i className="material-icons mdc-list-item__graphic" aria-hidden="true">logout</i>
                        <span className="mdc-list-item__text">Logout</span>
                    </a>
                </div>
            </div>
        </aside>;
    }
}

export default NavBar;
